import React from 'react'

export default function Track({ track }) {
  return (
    <div className='d-flex m-2 align-items-center'>

        <img scr={track.albumUrl}  />
        <div className='ml-7'>
            <div>{track.title}</div>
            <div className='text-muted'>{track.artist}</div>
        </div>
    </div>
  )
}
